css:
.sheet-container .sheet-toolbar .btn-toolbar img.content-mask {
  background-color: #f6f6f6;
}
.sheet-container .sheet-toolbar .sheet-toolbar-container {
  background-image: linear-gradient(to bottom, #51504a, #34332f);
  box-shadow: none;
}
.sheet-container .sheet-toolbar .sheet-toolbar-container .btn {
  background: #4c4b45;
}
.sheet-container .sheet-toolbar .sheet-toolbar-container .btn.btn-toolbar {
  color: #f6f6f6;
}
.sheet-container .sheet-toolbar .sheet-toolbar-container .toolbar-activity .activity-toolbar-icon {
  background: #f6f6f6;
}
.sheet-container .sheet-toolbar .item-back img.content-mask,
.sheet-container .sheet-toolbar .toolbar-menu-control img.content-mask {
  background-color: #f6f6f6;
}
.sheet-container .sheet-toolbar .item-back .item-back-title {
  color: #f6f6f6;
}
.sheet-container .sheet-toolbar .selection-bar .absolute {
  border-color: #4e4d47;
  background-color: #2c2b28;
}
.sheet-container .sheet-toolbar .selection-bar .absolute .inner .centered {
  color: #f6f6f6;
}
.btn-icon img.content-mask {
  background-color: #f6f6f6;
  color: #f6f6f6;
}
.btn-icon img.content-mask:hover {
  background-color: #f07746;
}
body.is-blurred .sheet-container .sheet-toolbar .sheet-toolbar-container {
  background-image: linear-gradient(to bottom, #34332f, #34332f);
}
.item-count-box {
  min-width: 15px;
  height: 15px;
  text-align: center;
  display: inline;
  font-size: 10.5px;
  padding: 0 0.286em 0 0.286em;
  line-height: 15px;
  border-radius: 2px;
  align-self: center;
}
body.platform-win32 .item-count-box {
  border-radius: 0;
}
.windows-btn-bg {
  transition: background 300ms, box-shadow 300ms;
  background: transparent;
  border-radius: 0;
}
.windows-btn-bg:hover {
  background: rgba(226, 226, 226, 0.8);
}
.windows-btn-border {
  border: 0;
  box-shadow: 0 0 0 2px rgba(226, 226, 226, 0.8);
}
.event-wrapper {
  cursor: default;
  position: relative;
  font-size: 13.02px;
  margin-top: 14px;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
  width: 100%;
  display: inline-block;
  border-radius: 3px;
  border: 1px solid #e2e2e2;
}
.event-wrapper .event-header {
  border-bottom: 1px solid #e2e2e2;
  padding: 10px;
  overflow: hidden;
  text-overflow: ellipsis;
}
.event-wrapper .event-header img {
  margin-right: 20px;
}
.event-wrapper .event-header .event-title-text {
  color: rgba(35, 31, 32, 0.5);
}
.event-wrapper .event-header .event-title {
  color: #231f20;
}
.event-wrapper .event-header .event-download {
  float: right;
  border-radius: 3px;
  border: 1px solid #e2e2e2;
  padding: 0 4px;
}
.event-wrapper .event-header .event-download img {
  background: rgba(35, 31, 32, 0.5);
  margin: 0;
}
.event-wrapper .event-body {
  padding: 10px;
  color: #231f20;
}
.event-wrapper .event-body .event-location {
  user-select: text;
}
.event-wrapper .event-body .event-date {
  display: inline-block;
  width: 100%;
}
.event-wrapper .event-body .event-date .event-day {
  display: block;
  font-size: 15.96px;
  color: #e64d65;
}
.event-wrapper .event-body .event-date .event-time {
  display: inline-block;
  font-size: 20.02px;
  font-weight: 300;
}
.event-wrapper .event-body .event-actions {
  display: flex;
}
.event-wrapper .event-body .event-actions .btn-rsvp {
  margin-right: 10.5px;
  margin-top: 5px;
  min-width: 85px;
  text-align: center;
}
.event-wrapper .event-body .event-actions .btn-rsvp:hover {
  background: #f4f4f4;
}
.event-wrapper .event-body .event-actions .btn-rsvp:active {
  background: #ededed;
}
.event-wrapper .event-body .event-actions .btn-rsvp.DECLINED {
  background: #d9534f;
  color: #ffffff;
}
.event-wrapper .event-body .event-actions .btn-rsvp.ACCEPTED {
  background: #5cb346;
  color: #ffffff;
}
.event-wrapper .event-body .event-actions .btn-rsvp.TENTATIVE {
  background: #77828d;
  color: #ffffff;
}
body.platform-win32 .event-wrapper {
  border-radius: 0;
}
body.platform-win32 .event-wrapper .event-body .event-actions .btn-rsvp {
  border-radius: 0;
}
